import http from "../http-common";
class MtuserDataService {
  getAll() {
    return http.get("/mt_user");
  }
  get(id) {
    return http.get(`/mt_user/${id}`);
  }
  create(data) {
    return http.post("/mt_user", data);//localhost:8000/api/mt_user(data)
  }
  update(id, data) {
    return http.put(`/mt_user/${id}`, data);
  }
  delete(id) {
    return http.delete(`/mt_user/${id}`);
  }
  deleteAll() {
    return http.delete(`/mt_user`);
  }
  findByTitle(firstname) {
    return http.get(`/mt_user?firstname=${firstname}`);
  }
}
export default new MtuserDataService();
